#

test_that("roundTime() works", {

  kwb.datetime:::roundTime(tstamp = NULL, tstep = NULL)
   kwb.datetime:::roundTime(tstamp = NULL, tstep = numeric())
   kwb.datetime:::roundTime(tstamp = NULL, tstep = 1)
   kwb.datetime:::roundTime(tstamp = NULL, tstep = 1:2)
   kwb.datetime:::roundTime(tstamp = NULL, tstep = logical())
   kwb.datetime:::roundTime(tstamp = NULL, tstep = TRUE)
   kwb.datetime:::roundTime(tstamp = NULL, tstep = FALSE)
   kwb.datetime:::roundTime(tstamp = numeric(), tstep = NULL)
   kwb.datetime:::roundTime(tstamp = numeric(), tstep = numeric())
   kwb.datetime:::roundTime(tstamp = numeric(), tstep = 1)
   kwb.datetime:::roundTime(tstamp = numeric(), tstep = 1:2)
   kwb.datetime:::roundTime(tstamp = numeric(), tstep = logical())
   kwb.datetime:::roundTime(tstamp = numeric(), tstep = TRUE)
   kwb.datetime:::roundTime(tstamp = numeric(), tstep = FALSE)
   kwb.datetime:::roundTime(tstamp = 1, tstep = NULL)
   kwb.datetime:::roundTime(tstamp = 1, tstep = numeric())
   kwb.datetime:::roundTime(tstamp = 1, tstep = 1)
   kwb.datetime:::roundTime(tstamp = 1, tstep = 1:2)
   kwb.datetime:::roundTime(tstamp = 1, tstep = logical())
   kwb.datetime:::roundTime(tstamp = 1, tstep = TRUE)
   kwb.datetime:::roundTime(tstamp = 1, tstep = FALSE)
   kwb.datetime:::roundTime(tstamp = 1:2, tstep = NULL)
   kwb.datetime:::roundTime(tstamp = 1:2, tstep = numeric())
   kwb.datetime:::roundTime(tstamp = 1:2, tstep = 1)
   kwb.datetime:::roundTime(tstamp = 1:2, tstep = 1:2)
   kwb.datetime:::roundTime(tstamp = 1:2, tstep = logical())
   kwb.datetime:::roundTime(tstamp = 1:2, tstep = TRUE)
   kwb.datetime:::roundTime(tstamp = logical(), tstep = NULL)
   kwb.datetime:::roundTime(tstamp = logical(), tstep = numeric())
   kwb.datetime:::roundTime(tstamp = logical(), tstep = 1)
   kwb.datetime:::roundTime(tstamp = logical(), tstep = 1:2)
   kwb.datetime:::roundTime(tstamp = logical(), tstep = logical())
   kwb.datetime:::roundTime(tstamp = logical(), tstep = TRUE)
   kwb.datetime:::roundTime(tstamp = logical(), tstep = FALSE)
   kwb.datetime:::roundTime(tstamp = TRUE, tstep = NULL)
   kwb.datetime:::roundTime(tstamp = TRUE, tstep = numeric())
   kwb.datetime:::roundTime(tstamp = TRUE, tstep = 1)
   kwb.datetime:::roundTime(tstamp = TRUE, tstep = 1:2)
   kwb.datetime:::roundTime(tstamp = TRUE, tstep = logical())
   kwb.datetime:::roundTime(tstamp = TRUE, tstep = TRUE)
   kwb.datetime:::roundTime(tstamp = TRUE, tstep = FALSE)
   kwb.datetime:::roundTime(tstamp = FALSE, tstep = NULL)
   kwb.datetime:::roundTime(tstamp = FALSE, tstep = numeric())
   kwb.datetime:::roundTime(tstamp = FALSE, tstep = 1)
   kwb.datetime:::roundTime(tstamp = FALSE, tstep = 1:2)
   kwb.datetime:::roundTime(tstamp = FALSE, tstep = logical())
   kwb.datetime:::roundTime(tstamp = FALSE, tstep = TRUE)
   kwb.datetime:::roundTime(tstamp = FALSE, tstep = FALSE)
   expect_error(
    kwb.datetime:::roundTime(tstamp = NULL, tstep = character())
    # non-numeric argument to binary operator
  )
   expect_error(
    kwb.datetime:::roundTime(tstamp = 1:2, tstep = FALSE)
    # NAs are not allowed in subscripted assignments
  )

})

